  return (

    <div className="body" >
       <img src="medical).png" alt="banner" class="img-fluid   rounded w-100" />
      {/* <div className="jumbotron container mt-4">
        <h1 className="display-4 mt-3 text-center">สั่งยาออนไลน์ผ่านแชทกับเภสัชง่ายๆ</h1>
        <p className="lead text-center mb-4">เรามีบริการส่งยาไปที่บ้าน สะดวก รวดเร็ว และมีความปลอดภัย</p>
    
      
      </div> */}
      
      
      
      {/* New Product */}
      <div className="bg">
      <h4 
      className="text-center p-3    mb-5 display-4 jumbotron  ">
          สินค้ามาใหม่
       </h4>
         <NewProduct />   
        





      {/* Best Seller */}
      <div >
     
      <h4 
      className="text-center p-3 mt-3  mb-5 display-4 jumbotron   ">
          <Badge bg="secondary">สินค้าขายอย่างดี</Badge>
       </h4>
       
        <BestSeller />
        </div>
        </div>
        <img src="1160_generated2.jpg" alt="banner" class="img-fluid   rounded  mt-3 " />
    </div>
  );
};

export default Home;
